import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './App.css';

const DemographicPage = () => {
  const [formData, setFormData] = useState({
    age: '',
    gender: '',
    // Add more demographic fields as needed
  });
  const navigate = useNavigate();

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Validate form data before submission
    if (formData.age && formData.gender) {
      // Submit form data
      // For demonstration, navigate to the next page
      navigate('/nextpage');
    } else {
      alert('Please fill in all required fields.');
    }
  };

  return (
    <div>
      {/* <h1>Demographics</h1> */}
      <p style={{ fontSize: '45px' }}>Demographics</p>
      <div style={{ height: '200px', overflowY: 'auto', border: '1px solid white', borderRadius: '5px', padding: '10px', width: '560px' }}>
        {/* Form for demographic questions */}
        <form onSubmit={handleSubmit}>
          <div>
            <label htmlFor="age" style={{ fontSize: '18px' }}>Age:</label>
            <input type="number" id="age" name="age" value={formData.age} onChange={handleInputChange} style={{ fontSize: '14px' }} />
          </div>
          <div>
            <label htmlFor="gender" style={{ fontSize: '18px' }}>Gender:</label>
            <select id="gender" name="gender" value={formData.gender} onChange={handleInputChange} style={{ fontSize: '14px' }}>
              <option value="">Select</option>
              <option value="male">Male</option>
              <option value="female">Female</option>
              <option value="other">Other</option>
            </select>
          </div>
          {/* Add more demographic fields as needed */}

        </form>
      </div>
      <button type="submit" className="App-button" style={{ marginTop: '20px' }}>
            Next
          </button>
    </div>
  );
};

export default DemographicPage;
